clearWorkspace:
clearWorkspace( [name, ][options] )
    Deletes user-defined variables in a specified workspace.

    Parameters
    ----------
    name: string (optional)
        Workspace name. Default: the current workspace.

    options: Object (optional)
    	Options.

    options.include: RegExp|ArrayLikeObject (optional)
    	Variable name inclusion filter.

    options.exclude: RegExp|ArrayLikeObject (optional)
    	Variable name exclusion filter.

    Examples
    --------
    // Create a new workspace:
    > workspace( 'foobar' );
    > var x = 3.14;

    // Switch to another workspace:
    > workspace( 'barfoo' );
    > typeof x

    // List the variables in the previous workspace:
    > varsWorkspace( 'foobar' )

    // Delete the variables in the previous workspace:
    > clearWorkspace( 'foobar' );
    > varsWorkspace( 'foobar' )

    // Navigate to the previous workspace:
    > workspace( 'foobar' );

    // Confirm that the variables were deleted:
    > x

    See Also
    --------
    assignin, clearVars, loadWorkspace, vars, varsWorkspaces, workspaces

evalin:
evalin( workspace, expression )
    Evaluates an expression in a specified workspace.

    Parameters
    ----------
    workspace: string
        Workspace name.

    expression: string
        Expression to evaluate.

    Examples
    --------
    // Create a workspace:
    > workspace( 'foobar' );

    // Create and switch to another workspace:
    > workspace( 'barfoo' );

    // Attempt to evaluate an expression in the first workspace:
    > evalin( 'foobar', 'var x = 3.14;' );

    // Check that nothing has changed in the current workspace:
    > x

    // Switch to the first workspace:
    > workspace( 'foobar' );

    // Check that the expression was successfully evaluated:
    > x

    See Also
    --------
    assignfrom, assignin, loadWorkspace, varsWorkspace, workspace, workspaces

renameWorkspace:
renameWorkspace( oldName, newName )
    Renames a workspace.

    The new workspace name must not already exist. The only exception is when
    the old name and the new name are the same; in which case, invoking this
    function is a non-operation.

    As a 'base' workspace must always exist, when renaming the 'base' workspace,
    variables from the 'base' workspace are simply copied to a new workspace and
    the 'base' workspace cleared of user-defined variables.

    Parameters
    ----------
    oldName: string
        Name of workspace to rename.

    newName: string
        New workspace name.

    Examples
    --------
    // Create a new workspace:
    > workspace( 'foobar' );
    > var x = 3.14;

    // List current workspaces:
    > workspaces()

    // Switch to another workspace:
    > workspace( 'barfoo' );

    // List current workspaces:
    > workspaces()

    // Rename the first workspace:
    > renameWorkspace( 'foobar', 'beepboop' );

    // Check the updated list of workspaces:
    > workspaces()

    // Switch to the renamed workspace:
    > workspace( 'beepboop' );

    // Confirm that workspace contains previously defined variables:
    > x


    See Also
    --------
    currentWorkspace, deleteWorkspace, loadWorkspace, workspace, workspaces
